function toggleMenu() {
    const menu = document.querySelector(".menu-links");
    const icon = document.querySelector(".hamburger-icon");
    menu.classList.toggle("open");
    icon.classList.toggle("open");
  }

const Navbar = () => {
    return (
      <nav className="navbar">
        <h1>Midd Gap</h1>
        <div className="links">
          <a href="/">Home</a>
          <a>
            <nav id="hamburger-nav">
                <div class="hamburger-menu">
                    <div class="hamburger-icon" onClick="toggleMenu()">
                        Boulders
                    </div>
                    <div class="menu-links">
                        <li><a href="/RoadsideBoulders" onClick="toggleMenu()">Roadside Boulders</a></li>
                        <li><a href="/HPBoulders" onClick="toggleMenu()">Harry Potter Boulders</a></li>
                    </div>
                </div>
            </nav>
          </a>

          {/* <a href="/RoadsideBoulders">Roadside Boulders</a>
          <a href="/HPBoulders">Harry Potter Boulders</a> */}
        </div>
      </nav>
    );
  }

  export default Navbar;
